import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation item to be visible
    await page.waitForSelector('.nav-item[data-page="history"]', { timeout: 5000 });

    // Click on the History navigation item
    await page.click('.nav-item[data-page="history"]');

    // Wait for the history page to load completely (if needed)
    await page.waitForLoadState('networkidle');

    // Take a screenshot after clicking on the History menu item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_history_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_history_clicked.png'));

    // Extract confirmation that history is displayed (e.g., check for specific content)
    const historyVisible = await page.isVisible('text=Your Watch History');

    return {
      success: true,
      action: "Clicked on the History menu item and verified page load.",
      extractedData: { historyVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
